import React from 'react';
import {Link} from 'react-router-dom';

const accommodationTerm = (props) => {
    return (
        <tr>
            <td>{props.term.name}</td>
            <td>{props.term.category.name}</td>
            <td>{props.term.host.name}</td>
            {/*<td>{props.term.numRooms}</td>*/}
            {/*<td>{props.term.isRented}</td>*/}
            <td className={"text-right"}>
                <a title={"Delete"} className={"btn btn-danger"}
                   onClick={() => props.onDelete(props.term.id)}>
                    Delete
                </a>
                <Link className={"btn btn-info ml-2"}
                      onClick={() => props.onEdit(props.term.id)}
                      to={`/edit-accommodation/${props.term.id}`}>
                    Edit
                </Link>
            </td>
        </tr>
    )
}

export default accommodationTerm();
